import './App.css';
import React, {useEffect, useRef} from "react";
import {browserRouter as Router, Route, Switch} from "react-rouer-dom"
import {connect} from "react-redux"
import {setCryptoData, addCryptoData} from "./store/actions/actionCreators";

function App(props) {


  useEffect(()=> {
    props.setCryptoData();
  })

  const inputRef = useRef();
  return (
    <div className="App">
     <h1>Hello World</h1>
     {props.cryptoData.map((value)=>{
       return <p>{value.id}</p>
       console.log(value)
     })}
    </div>
  );
}

const mapStateToProps = (state)=> {
  return {
    cryptoData:  state.cryptoData
  }
}

export default connect(mapStateToProps, {setCryptoData, addCryptoData})(App);
